leadingComments.value:
*
 * Strict JS Objects and Collections created from JSON Schema Definitions
 * @class JSD
 * @example const _jsd = new JSD();
 * _jsd.document = {name: 'test'};
 * console.log(`${jsd.document.name}`);
 * // -> 'test'
 * console.log(`${jsd.document.get('.'}`);
 * // -> Schema

